import React, { useState } from 'react';
import styled from 'styled-components';
import { KonkurranseInfo } from '../konkurranseInfo';
import { Rutenett } from '../rutenett';

export function Konkurranse() {
  const [count, setCount] = useState(1);

  const handleCount = (index: number) => {
    setCount(index);
  };

  return (
    <Wrapper>
      <Header>Vinn gavekort fra Komplett!</Header>
      <div>
        <Rutenett index={count} handleCount={handleCount} />
      </div>
      <div>
        <KonkurranseInfo />
      </div>
    </Wrapper>
  );
}

const Wrapper = styled.div`
  display: grid;
  grid-template-columns: 1.4fr 1fr;
  grid-template-rows: 0.125fr 1fr;
  /* padding: 2.45vh 1.5vw; */
`;

export const Header = styled.h1`
  font-family: 'Neue Machina';
  color: blue;
  font-size: 4vw;
  font-weight: 900;
  grid-column: 1 / 3;
`;

